import React from "react";

import "../css/App.css";

function FilmOfWeek(){
    return(
        <div>
            <div className="filmOfWeekDiv">
                <h1>Film of the Week</h1>

                <div className="currentFilm">
                    <p> Joker </p>
                </div>
            </div>
        </div>
    );
}

export default FilmOfWeek;
